g2:c.PROCEDURE.g2:a.TEXT:
guide-confirm-temp-storage-for-slider (D:class uil-dialog, O:class item, W:class ui-client-item, B: item-or-value, SL:class symbol-list)
OBJ: class item;
current-value: quantity;
TOK: text;
begin
    if not (there exists an item that is the-uil-temporary-storage-object-of D) then
        inform the operator that "D does not have a uil-temporary-storage-object"
    else
        begin
        OBJ = the item that is the-uil-temporary-storage-object-of D;

        conclude that the lo-value of B = the obj-low-value of OBJ;
        conclude that the hi-value of B = the obj-hi-value of OBJ; 
        conclude that the allow-fractional-increments of B = the obj-allow-fractional-increments of OBJ; 
        conclude that the set-value-while-sliding of B = the obj-set-value-while-sliding of OBJ;
        if (the set-value-while-sliding of B is true) and (the uil-conclude-value-immediately of B is false) then
            begin
            TOk = call upp-post-confirm-dialog ("The slider is configured to set values while sliding, however uil-conclude-value-immediately is set to false. Would you like to set uil-conclude-immediately to true?", W);
            if (TOk = "yes") then
                conclude that the uil-conclude-value-immediately of B is true;
            end;
        end; {----- uil-temporary-storage-object exists -----}
end

guide-setup-temp-storage-for-slider (D:class uil-dialog, O:class item)
OBJ: item-or-value;
begin
    if not (there exists an item that is the-uil-temporary-storage-object-of D) then
        inform the operator that "D does not have a uil-temporary-storage-object"
    else
        begin
        OBJ = the item that is the-uil-temporary-storage-object-of D;

        conclude that the obj-low-value of OBJ = the lo-value of O;
        conclude that the obj-hi-value of OBJ = the hi-value of O; 
        conclude that the obj-allow-fractional-increments of OBJ = the allow-fractional-increments of O; 
        conclude that the obj-set-value-while-sliding of OBJ = the set-value-while-sliding of O;

        end; {----- uil-temporary-storage-object exists -----}
end
